	add("curd", "{\"term\":\"curd\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\"], \"text\":\"metathesis of \u0027crud\u0027 from Middle english (1100-1500) \u0027crud\u0027 (lang\u003denm)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The part of milk that coagulates when it sours or is treated with enzymes; used to make cottage cheese\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The coagulated part of any liquid\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The edible flower head of certain brassicaceous plants\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"R. Thompso\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Broccoli should be cut while the \u0027\u0027curd\u0027\u0027, as the flowering mass is termed, is entire\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"F. Bur\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Cauliflowers should be cut for use while the head, or \u0027\u0027curd\u0027\u0027, is still close and compact\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"pages\u003d162–163|isbn\u003d978-1-119-99223-3|passage\u003dThis beautiful vegetable \u0026amp\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Romanesco broccoli\u0026amp\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"93; looks rather like a green cauliflower designed by a mathematician and has lime-green \u0027spiralled\u0027 \u0027\u0027curds\u0027\u0027. The \u0027\u0027curds\u0027\u0027 are nutty and tasty, and romanesco is worth growing just for its good looks. You can use romanesco in the same ways that you would normally use cauliflower but the flavour is sweeter and they look far more impressive. I try to leave them in large pieces when serving them because they\u0027re so beautiful\", \"priority\":10}]}, \"synonyms\":{}}");

	add("cure", "{\"term\":\"cure\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027cure\u0027 (lang\u003dfro) from Latin \u0027cura\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A method, device or medication that restores good health\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL5535161W Mr. Pratt\u0027s passage\u003dWhen you\u0027re well enough off so\u0027s you don\u0027t have to fret about anything but your heft or your diseases you begin to get queer, I suppose. And the queerer the \u0027\u0027cure\u0027\u0027 for those ailings the bigger the attraction. A place like the Right Livers\u0027 Rest was bound to draw freaks, same as molasses draws flies\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Act of healing or state of being healed; restoration to health from disease, or to soundness after injury\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Past hope! past \u0027\u0027cure\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Bible, Luke xii. 3\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"I do \u0027\u0027cures\u0027\u0027 to-day and to-morrow\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A solution to a problem\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Dryde\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Cold, hunger, prisons, ills without a \u0027\u0027cure\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Bishop Hur\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"the proper \u0027\u0027cure\u0027\u0027 of such prejudice\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A process of preservation, as by smoking\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A process of solidification or gelling\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A process whereby a material is caused to form permanent molecular linkages by exposure to chemicals, heat, pressure and/or weathering\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Care, heed, or attention\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Chauce\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Of study took he most \u0027\u0027cure\u0027\u0027 and most heed\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Fulle\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"vicarages of great \u0027\u0027cure\u0027\u0027, but small valu\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"Spiritual charge; care of soul; the office of a parish priest or of a curate\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"Spelma\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"The appropriator was the incumbent parson, and had the \u0027\u0027cure\u0027\u0027 of the souls of the parishioners\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"That which is committed to the charge of a parish priest or of a curate; a curacy\", \"priority\":24}]}, \"synonyms\":{}}");

	add("curl", "{\"term\":\"curl\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From metathesis of Middle english (1100-1500) \u0027lang\u003denm\u0027 from unattested Old english (ca. 450-1100) term, ultimately from Proto-germanic {{m|gem-pro|*krusl-}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A piece or lock of curling hair; a ringlet\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1866\u0027\u0027, \u0027s:Behind A Mask or, A Woman\u0027s Behind A Mask or, A Woman\u0027s Power\u0027, chapter 7\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"she took it down, looked long and fondly at it, then, shaking her \u0027\u0027curls\u0027\u0027 about her face, as if to hide the act, pressed it to her lips and seemed to weep over it in an uncontrollable paroxysm of tender grief\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.gutenberg.org/ebooks/11593 The Purchase chapter\u003d1|passage\u003dSerene, smiling, enigmatic, she faced him with no fear whatever showing in her dark eyes.She put back a truant \u0027\u0027curl\u0027\u0027 from her forehead where it had sought egress to the world, and looked him full in the face now, drawing a deep breath which caused the round of her bosom to lift the lace at her throat\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d17|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dThe face which emerged was not reassuring.\u0026amp;nbsp;[…]. He was not a mongol but there was a deficiency of a sort there, and it was not made more pretty by a latter-day hair cut which involved eccentrically long elf-locks and oiled black \u0027\u0027curls\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A curved stroke or shape\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, John Curtis, Julian Reade, \u0026amp; Dominique Collon, \u0027Art and Empire: Treasures from Assyria in the British Museum‎\u0027, page 184\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"the backs of their necks and their forelegs are decorated with \u0027\u0027curls\u0027\u0027 and their necks and bodies are covered with fine, undulating lines\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A spin making the trajectory of an object curve\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1909\u0027\u0027, Harold Horsfall Hilton, \u0027The Six Handicap Golfer\u0027s Companion\u0027\u0026lt;sup\u0026gt;[http://books.google.com/books?id\u003dfZ0XAAAAYAAJ]\u0026lt;/sup\u0026gt;, page 38\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"It is possible to use the wind which blows from the left to the right by playing well into the wind with the slightest bit of \u0027\u0027curl\u0027\u0027 on the ball\u0026amp;nbsp;[\u0026amp;hellip\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Movement of a moving rock away from a straight line\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Any exercise performed by bending the arm, wrist, or leg on the exertion against resistance, especially those that train the biceps\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027 (Jan/Feb), Jon Crosby, \u0026quot;Your Winter Muscle Makeover\u0026quot;, \u0027Men\u0027s Health\u0027, page 54\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Now do a \u0027\u0027curl\u0027\u0027 and an overhead press, keeping your palms facing in\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The vector field denoting the rotationality of a given vector field\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Erich Prisner, \u0027Graph dynamics\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"In 2D, when Q is a polygonal domain, the singularities of Type (2) disappear because \u0027ψ\u0027 is the scalar \u0027\u0027curl\u0027\u0027 of \u0027u\u0027 and is such that its vectorial \u0027\u0027curl\u0027\u0027 is zero\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"The vector operator, denoted \u0026lt;small\u0026gt;\u0026lt;math\u0026gt; rm{curl} ;\u0026lt;/math\u0026gt;\u0026lt;/small\u0026gt; or \u0026lt;small\u0026gt;\u0026lt;math\u0026gt; vec{ nabla} times vec{ left( cdot right)}\u0026lt;/math\u0026gt;\u0026lt;/small\u0026gt;, that generates this field\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"Any of various diseases of plants causing the leaves or shoots to curl up; often specifically the potato curl\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"1840\u0027\u0027, \u0026quot;Farmers\u0027 Department\u0026quot;, \u0027The Family Magazine\u0027, volume 1, [http://books.google.com/books?id\u003daKHPAAAAMAAJ\u0026amp;pg\u003dPA227 page 227\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"These potatoes, however, planted the next year, have a fair yield, untouched by the \u0027\u0027curl\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"The contrasting light and dark figure seen in wood used for stringed instrument making; the flame\", \"priority\":23}]}, \"synonyms\":{}}");

