	add("curation", "{\"term\":\"curation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027curacion\u0027 from Latin \u0027cūrātiō\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of curating, of organizing and maintaining a collection of artworks or artifacts\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of curing or healing\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The manual updating of information in a database\", \"priority\":3}]}, \"synonyms\":{}}");

