	add("curfew", "{\"term\":\"curfew\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027coeverfu\u0027 and Old french (842-ca. 1400) \u0027cuevre-fu\u0027 (French \u0027couvre-feu\u0027 , from the imperative of \u0027covrir\u0027 (to cover) + \u0027fu\u0027 (fire)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any regulation requiring people to be off the streets and in their homes by a certain time\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027 October 31, David M. Halbfinger, \u0026quot;[http://www.nytimes.com/2012/11/01/nyregion/new-jersey-continues-to-cope-with-hurricane-sandy.html?hp Hurricane Sandy],\u0026quot; \u0027New York Times\u0027 \u0026lt;small\u0026gt;(retrieved 31 October 2012)\u0026lt;/small\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Localities across New Jersey imposed \u0027\u0027curfews\u0027\u0027 to prevent looting. In Monmouth, Ocean and other counties, people waited for hours for gasoline at the few stations that had electricity. Supermarket shelves were stripped bare\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The time when such restriction begins\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A signal indicating this time\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A fireplace accessory designed to bank a fire by completely covering the embers\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A regulation in feudal Europe by which fires had to be covered up or put out at a certain fixed time in the evening, marked by the ringing of an evening bell\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The evening bell, which continued to be rung in many towns after the regulation itself became obsolete\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Folio Society, 2006, vol.1, p.95\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"I have my lodging neere unto a tower, where both evening and morning a very great bell doth chime \u0027Ave marie\u0027 and \u0027\u0027\u0027Cover-few\u0027\u0027\u0027, which jangling doth even make the tower to shake\", \"priority\":10}]}, \"synonyms\":{}}");

	add("curia", "{\"term\":\"curia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|la|curia|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of the subdivisions of a tribe in ancient Rom\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The Roman senate during the republi\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any of several medieval councils or courts of justice\", \"priority\":3}]}, \"synonyms\":{}}");

	add("curio", "{\"term\":\"curio\", \"etymology\":{\"influencers\":[], \"languages\":[\"French\"], \"text\":\"1851, {{abbreviation of|curiosity|lang\u003den}}\u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt; Compare {{w|cabinet of curiosities}} and French {{m|fr|objet de curiosité}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A strange and interesting object which invokes curiosity\", \"priority\":1}]}, \"synonyms\":{}}");

	add("curiosity", "{\"term\":\"curiosity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027curiouseté\u0027 from Latin {{m|la|cūriōsitātem}}, from \u0027curiosus\u0027 Surface analysis {{suffix|curious|ity}}; see {{m|en|-osity}}.\u0026lt;ref\u0026gt;[http://english.stackexchange.com/questions/197173/why-is-it-spelled-curiosity-instead-of-curiousity Why is it spelled “curiosity” instead of “curiousity?”]\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Careful, delicate construction; fine workmanship, delicacy of building\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1631\u0027\u0027, John Smith, \u0027Advertisements\u0027, in Kupperman 1988, p. 81\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"wee built a homely thing like a barne, set upon Cratchets, covered with rafts, sedge, and earth, so also was the walls; the best of our houses of the like \u0027\u0027curiosity\u0027\u0027, but the most part farre much worse workmanship\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Inquisitiveness; the tendency to ask and learn about things by asking questions, investigating, or exploring\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"It was the first time that the lawyer had been received in that part of his friend\u0027s quarters; and he eyed the dingy, windowless structure with \u0027\u0027curiosity\u0027\u0027, and gazed round with a distasteful sense of strangeness as he crossed the theatr\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1956\u0027\u0027, \u0027\u0027, p 39\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"quot;Certainly there is nothing wrong with Alvin\u0027s intelligence, but many of the things that should concern him seem to be a matter of complete indifference. On the other hand, he shows a morbid \u0027\u0027curiosity\u0027\u0027 regarding subjects which we do not generally discuss.\u0026quot\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.americanscientist.org/issues/feature/2013/5/lifelong-impact-of-early-self-control Lifelong Impact of Early passage\u003d\u0027\u0027Curiosity\u0027\u0027 about the power of self-control skills, which include conscientiousness, self-discipline, and perseverance, arose from recent empirical observations that preschool Head Start, an ambitious, federally funded program of special services launched in 1965 to boost the intellectual development of needy children, has failed to achieve the goal of boosting IQ scores. But the programs have unexpectedly succeeded in lowering the former pupils’ rates of teen pregnancy, school dropout, delinquency, and work absenteeism\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A unique or extraordinary object which arouses interest\", \"priority\":9}]}, \"synonyms\":{}}");

	add("curiousness", "{\"term\":\"curiousness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|curious|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"inquisitiveness; curiosit\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"care; carefulness; pain\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Massinge\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"My father\u0027s care / With \u0027\u0027curiousness\u0027\u0027 and cost did train me up\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The state of being curious; exactness of workmanship; ingenuity of contrivance\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The result or product of being curious\", \"priority\":6}]}, \"synonyms\":{}}");

