	add("curling", "{\"term\":\"curling\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|en|curling|lang\u003dfr}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The action or motion of something that curls\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"curlings\u0027\u0027 of smoke\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a scornful \u0027\u0027curling\u0027\u0027 of the lip\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A winter sport where players aim and slide stones down a sheet of ice and attempt to get their color stones closest to the house (a circular target marked on the ice\", \"priority\":4}]}, \"synonyms\":{\"list\":[{\"text\":\"kurlaus\", \"synonymQualifier\":\"INFORMAL\"}]}}");

	add("curlyhead", "{\"term\":\"curlyhead\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|curly|head|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person with curly hair\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1930\u0027\u0027, Fitzhugh Buckner, \u0027Hooper dooper\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027curlyhead\u0027\u0027 was laughing politely and robustly\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Phyllis Shand Allfrey, Lizabeth Paravisini-Gebert, \u0027The orchid house\u0027 (page 6\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I would say that thank goodness there was no danger of any \u0027\u0027curlyheads\u0027\u0027 in Madam and the Master\u0027s family\", \"priority\":5}]}, \"synonyms\":{}}");

	add("curmudgeon", "{\"term\":\"curmudgeon\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Numerous folk etymologies exist for this word.An alternative spelling attested in 1600 is \u0027cornmudgin\u0027, in Holland\u0027s translation of Livy, rendering \u0027frumentarius\u0027 \u0026quot;corn-merchant\u0026quot;. This has been suggested as the original form of the word, but [http://en.wikipedia.org/wiki/Oxford English Dictionary OED] notes that \u0027curmudgeon\u0027 is attested some years before this, concluding that \u0027cornmudgin\u0027 was merely a nonce-word by Holland.The word is attested from the late 1500s in the forms \u0027curmudgeon\u0027 and \u0027curmudgen\u0027, and during the 17th century in numerous spelling variants, including \u0027cormogeon, cormogion, cormoggian, cormudgeon, curmudgion, curmuggion, curmudgin, curr-mudgin, curre-megient\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A miser\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An ill-tempered (and frequently old) person full of stubborn ideas or opinions\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There\u0027s a cranky \u0027\u0027curmudgeon\u0027\u0027 working at the hospital who gives all the patients and other doctors flak\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"John Doe\u0027s old age and stubborn aversion to new ideas make him a \u0027\u0027curmudgeon\u0027\u0027 of a candidate\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Jeet Heer, \u0027Gravitas\u0027, [http://www.jeetheer.com/culture/newcriterion.htm Autumn 1996\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"After a while, as cultural debates became more polarized, the editorial tone of the \u0027New Criterion\u0027 went from being charmingly \u0027\u0027curmudgeon\u0027\u0027 to being bitterly shrill\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, The New York Times [http://www.nytimes.com/2006/01/18/technology/circuits/19POGUE-EMAIL.html?ex\u003d1179201600\u0026amp;en\u003df058e59799358d61\u0026amp;ei\u003d5070\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"How to Be a \u0027\u0027Curmudgeon\u0027\u0027 on the Interne\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, The Times [http://www.timesonline.co.uk/tol/life_and_style/court_and_social/modern_times/article1726275.ece\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"How should I respond, without appearing to be a \u0027\u0027curmudgeon\", \"priority\":10}]}, \"synonyms\":{}}");

	add("curmurring", "{\"term\":\"curmurring\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"scots\"], \"text\":\"From Scots \u0027curmur\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A low-pitched murmuring, grumbling sound\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Flatulence\", \"priority\":2}]}, \"synonyms\":{}}");

	add("currach", "{\"term\":\"currach\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Irish\"], \"text\":\"From Irish \u0027curach\u0027 \u0027\u0027 from Proto-celtic {{m|cel-pro|*kurukos||boat}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An Irish boat, constructed like a coracle, and originally the same shape; now a boat of similar construction but conventional shape and large enough to be operated by up to eight oars\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Joseph O\u0027Connor, \u0027Star of the Sea\u0027, Vintage 2003, page 53\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Some days he went out in the \u0027\u0027currach\u0027\u0027 with her father and her brothers, out past Blue Island and Inishlackan, where the mackerel and sea salmon were fat as piglets\", \"priority\":3}]}, \"synonyms\":{}}");

	add("currawong", "{\"term\":\"currawong\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Probably from {{w|Yagara}} \u0027garrawaŋ\u0027, ultimately onomatopoeic.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of the three species, and several subspecies, of large, mainly black, predatory passerine birds in the genus \u0027Strepera\u0027, of the family Artamidae, endemic to Australia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027, Robert Drewe, \u0027The Bodysurfers\u0027, Penguin 2009, p. 68\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Currawongs\u0027\u0027 and cookaburras woke him early\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, \u0027Illywhacker\u0027, Faber and Faber 2003, p. 174\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"She has small unblinking eyes like a \u0027\u0027currawong\u0027\u0027, turning its head on one side and staring malevolently […\", \"priority\":5}]}, \"synonyms\":{}}");

	add("currency", "{\"term\":\"currency\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From \u0027currentia\u0027, from Latin \u0027currens\u0027, from \u0027curro|currō\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Money or other items used to facilitate transactions\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Wampum was used as a \u0027\u0027currency\u0027\u0027 by Amerindians\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Paper money\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1943\u0027\u0027, , chapter 3\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Spangler went through his pockets, coming out with a handful of small coins, one piece of \u0027\u0027currency\u0027\u0027 and a hard-boiled egg\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The state of being current; general acceptance or recognition\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The jargon’s \u0027\u0027currency\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"fluency; readiness of utteranc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Current value; general estimation; the rate at which anything is generally valued\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"He takes greatness of kingdoms according to their bulk and \u0027\u0027currency\u0027\u0027, and not after intrinsic value.\u0027 \u0026amp;mdash; Francis Bacon\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The bare name of Englishman too often gave a transient \u0027\u0027currency\u0027\u0027 to the worthless and ungrateful.\u0027 \u0026amp;mdash; W. Irving\", \"priority\":11}]}, \"synonyms\":{}}");

	add("curriculum", "{\"term\":\"curriculum\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027curriculum\u0027 (course) derived from {{m|la|currō||run, move quickly}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The set of courses, coursework, and their content, offered at a school or university\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A racecourse; a place for running\", \"priority\":2}]}, \"synonyms\":{}}");

	add("currier", "{\"term\":\"currier\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027corier\u0027 from Latin \u0027coriarius\u0027 (tanner, currier)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A specialist in the leather processing industry\", \"priority\":1}]}, \"synonyms\":{}}");

	add("curse", "{\"term\":\"curse\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) from Late Old english (ca. 450-1100) \u0027curs\u0027 (curse) of unknown origin.\u0026lt;!-- Is the following supposed to be the etymology for the menstrual sense?“Courses” monthly flows - Bailey’s Dictionary 1761--\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A supernatural detriment or hindrance; a bane\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A prayer or imprecation that harm may befall someone\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The cause of great harm, evil, or misfortune; that which brings evil or severe affliction; torment\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The common \u0027\u0027curse\u0027\u0027 of mankind, folly and ignorance\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A vulgar epithet\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.guardian.co.uk/books/2013/may/23/holy-shit-history-swearing-mohr Where the profound meets the passage\u003dSwearing doesn\u0027t just mean what we now understand by \u0026quot;dirty words\u0026quot;. It is entwined, in social and linguistic history, with the other sort of swearing: vows and oaths. Consider for a moment the origins of almost any word we have for bad language – \u0026quot;profanity\u0026quot;, \u0026quot;\u0027\u0027curses\u0027\u0027\u0026quot;, \u0026quot;oaths\u0026quot; and \u0026quot;swearing\u0026quot; itself\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A woman\u0027s menses\", \"priority\":8}]}, \"synonyms\":{}}");

	add("cursor", "{\"term\":\"cursor\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027cursor\u0027 (runner) from {{m|la|currō||run}} + \u0027-or\u0027 (agentive suffix) Ultimately from Proto-Indo-European.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A part of any of several scientific instruments that moves back and forth to indicate a positio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A moving icon or other representation of the position of the pointing device\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An indicator, often a blinking line or bar, indicating where the next insertion or other edit will take place. Also referred to as \u0026quot;the caret\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A reference to a row of data in a table, which moves from row to row as data is retrieved by way of it\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A design pattern in object oriented methodology in which a collection is iterated uniformly, also known as the iterator pattern\", \"priority\":5}]}, \"synonyms\":{}}");

	add("curtain", "{\"term\":\"curtain\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027cortine\u0027 from Latin \u0027cortina\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A piece of cloth covering a window, bed, etc. to offer privacy and keep out light\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Thus the red damask \u0027\u0027curtains\u0027\u0027 which now shut out the fog-laden, drizzling atmosphere of the Marylebone Road, had cost a mere song, and yet they might have been warranted to last another thirty years. A great bargain also had been the excellent Axminster carpet which covered the floor; as, again, the arm-chair in which Bunting now sat forward, staring into the dull, small fire\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A similar piece of cloth that separates the audience and the stage in a theater\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"will prove a good burlesque\u0026amp;nbsp;; but it all began dramatically enough. It was last Saturdaythat two boys, playing in the little spinney just outside Wembley Park Station, came across three large parcels done up in American cloth.”\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The flat area of wall which connects two bastions or towers; the main area of a fortified wall\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Folio Society, 2006, vol.1, p.220\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Captain \u0027Rense\u0027, beleagring the Citie of \u0027Errona\u0027 for us,caused a forcible mine to be wrought under a great \u0027\u0027curtine\u0027\u0027 of the walles\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Death\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"For life is quite absurd / And death\u0027s the final word / You must always face the \u0027\u0027curtain\u0027\u0027 with a bow\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"That part of a wall of a building which is between two pavilions, towers, etc\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A flag; an ensign\", \"priority\":11}]}, \"synonyms\":{}}");

	add("curtains", "{\"term\":\"curtains\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An end, deat\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"It\u0027s \u0027\u0027curtains\u0027\u0027 for you\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;\u0027What if a bunch of scuba divers nosed about here?\u0027\u0026quot; / \u0026quot;\u0027\u0027\u0027Curtains\u0027\u0027 for them, when our wikipedia:side-scan side-scan sonar sees them.\u0027\u0026quot\", \"priority\":3}]}, \"synonyms\":{}}");

