	add("curveball", "{\"term\":\"curveball\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|curve|ball|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A forespin pitch thrown by rotating the index and middle fingers down and resulting in motion down \u0026quot;curve\u0026quot\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He bit on a \u0027\u0027curveball\u0027\u0027 in the dirt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An unexpected turn of events initiated by an opponent or chance\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Life has thrown him a few \u0027\u0027curveballs\", \"priority\":4}]}, \"synonyms\":{}}");

